#-------------------------------------------#
# 			Outlook Policy Task				#
#-------------------------------------------#

$TaskName = "Outlook Alert Rule"
$TaskDescription = "This script is requested by CORPCOMM"

$path = "C:\Temp"

# Check if the directory exists
if (-Not (Test-Path -Path $path)) {
    # Create the directory
    New-Item -Path $path -ItemType Directory | Out-Null
    Write-Output "Directory $path created successfully."
} else {
    Write-Output "Directory $path already exists."
}

# Define the VBS script path
$vbsPath = Join-Path "C:\Temp" "OutlookRule.vbs"

# Create a VBScript file for updating wallpaper
$vbsContent = @"
On Error Resume Next ' Ignore errors

Dim olApp, olStores, olStore, olRules, newRule
Dim ConditionFrom, ConditionSubject, ActionPlaySound

' Create an Outlook Application object
Set olApp = CreateObject("Outlook.Application") 
Set olStores = olApp.Session.Stores  ' Get all mailboxes

' Loop through all configured mailboxes
For Each olStore In olStores
    ' Get the rules for this mailbox
    Set olRules = olStore.GetRules()

    If Not olRules Is Nothing Then
        RuleName = "Urgent Alert Notification"
        RuleIndex = -1

        ' Check if rule already exists
        For i = 1 To olRules.Count
            If olRules.Item(i).Name = RuleName Then
                RuleIndex = i
                Exit For
            End If
        Next

        ' If rule exists, delete it
        If RuleIndex <> -1 Then
            olRules.Remove RuleIndex
        End If

        ' Create a new rule
        Set newRule = olRules.Create(RuleName, 0) ' 0 = olRuleReceive

        ' Condition: Email from "bishnu.panigrahi@gainwellindia.com"
        Set ConditionFrom = newRule.Conditions.From
        ConditionFrom.Enabled = True
        ConditionFrom.Recipients.Add "Bishnu Prasad Panigrahi"

        ' Condition: Subject contains "Urgent Alert"
        Set ConditionSubject = newRule.Conditions.Subject
        ConditionSubject.Enabled = True
        ConditionSubject.Text = Array("Testing Alert")

        ' Action: Play Sound
        Set ActionPlaySound = newRule.Actions.PlaySound
        ActionPlaySound.Enabled = True
        ActionPlaySound.FilePath = "C:\Music\IPL-Alert.wav"

        ' Save the rule
        olRules.Save()

        ' Cleanup
        Set newRule = Nothing
        Set ConditionFrom = Nothing
        Set ConditionSubject = Nothing
        Set ActionPlaySound = Nothing
    End If
Next

' Cleanup
Set olStores = Nothing
Set olApp = Nothing
"@

# Save the combined script to the file
$null = Set-Content -Path $vbsPath -Value $vbsContent

# Get current logged-in user in "DOMAIN\Username" format
$CurrentUser = Get-CimInstance -ClassName Win32_ComputerSystem | Select-Object -ExpandProperty UserName

# Define the action to run the VBS script
$Action = New-ScheduledTaskAction -Execute $vbsPath

# Create the logon-based trigger
$logonTrigger = New-ScheduledTaskTrigger -AtLogOn

# Create the session state change trigger for unlock
$StateChangeTrigger = Get-CimClass -Namespace Root/Microsoft/Windows/TaskScheduler -ClassName MSFT_TaskSessionStateChangeTrigger
$onUnlockTrigger = New-CimInstance -CimClass $StateChangeTrigger -Property @{StateChange = 8} -ClientOnly

# Store all triggers in an array
$triggers = @($logonTrigger, $onUnlockTrigger)

# Set task to run for any user and with highest privileges
$Principal = New-ScheduledTaskPrincipal -UserId $CurrentUser

# Define the task settings
$taskSettings = New-ScheduledTaskSettingsSet -AllowStartIfOnBatteries -DontStopIfGoingOnBatteries -WakeToRun -StartWhenAvailable
$taskSettings.Hidden = $true
$taskSettings.DisallowStartIfOnBatteries = $false
$taskSettings.Priority = 7
$taskSettings.ExecutionTimeLimit = "PT0S"

# Register the task
$null = Register-ScheduledTask -Action $Action -TaskName $TaskName -Description $TaskDescription -Trigger $triggers -Principal $Principal -Settings $taskSettings -Force

Start-Sleep -Seconds 10
Start-ScheduledTask -TaskName "$TaskName"

Write-Host "Outlook Alert Policy has been created and applied for $CurrentUser." -ForegroundColor Green
